import React, {Component, useState} from 'react';
import {Row, Col, Dropdown, DropdownButton, DropdownItem, DropdownDivider} from "react-bootstrap";
import { Modal, Button } from 'react-bootstrap';

function RoomDetails(){
    const [showModal, setShowModal] = useState(true);

    function handleCloseModal() {
        setShowModal(false);
    }

    return(    
        <div id="RoomDetailsModal">
            <Modal centered show={showModal} onHide={handleCloseModal}>
                <Modal.Header closeButton>
                    <Modal.Title>RoomDetails</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <DropdownButton title="Dropdown button" id="dropdown-basic-button">
                        <Dropdown.Item eventKey="X">View By Month</Dropdown.Item>
                        <DropdownDivider/>
                        <Dropdown.Item eventKey="X">View By Week</Dropdown.Item>
                    </DropdownButton>
                </Modal.Body>
                <Modal.Footer>

                    <Button id="CreateReservationButton" variant="primary" onClick={handleCloseModal}>
                        Create Reservation
                    </Button>
                    
                    <Button variant="secondary" onClick={handleCloseModal}>
                        Close
                    </Button>
                    
                </Modal.Footer>
            </Modal>
        </div>
    );
}

export default RoomDetails
